// -----------------------loading State-----------------------

class App extends Component {

    // 모든 컴포넌트가 state가 있는것이 아니고, 사용하지않는 것도 있ㅇㅁ
    // smart component: state 있음
    // dumb component : state없음(props만 있음) - functional comp로 바꾸면 됨
    state = {

    };

    componentDidMount() {
        setTimeout(() => {
            this.setState({
                movies: [
                {
                    title: "Matrix",
                    poster: "data:image/jpeg;base64,",

                },
                {
                    title: "Full Metal Jacket",
                    poster: "data:image/jpeg;base64,"
                },
                {
                    title: "Oldboy",
                    poster: "data:image/jpeg;base64,"
                },
                {
                    title: "StarWars",
                    poster: "data:image/jpeg;base64,"
                },
                {
                    title: 'Meowed',
                    poster: "data:image/jpeg;base64,"
                }
            ]
            })
        }, 3000)
    }

    // _ :: 자체 함수와 개발자가 만든 함수와 다름을 표시하고자 함
    _renderMovies = () => {
        const movies = this.state.movies.map((movie, index) => {
            return <Movie title={movie.title} poster={movie.poster} key={index} />
        });
        return movies;
    };


  render() {
    return (
        <div className="App">
            {this.state.movies ? this._renderMovies() : 'loading...'}
        </div>
    )
  }
}


export default App;

